  (
    37,
    'FS: RUROUNI KENSHIN',
    'Setelah hampir 30 tahun serial mengudara, anime TV baru Rurouni Kenshin akan segera hadir. Pemutaran Spesial Rurouni Kenshin terdiri dari 4 episode pertama dari anime TV baru yang tayang perdana pada 6 Juli 2023. Selama era kekerasan yang dikenal sebagai Bakumatsu, seorang pembunuh Ishin yang hanya dikenal sebagai Hitokiri Battousai, dengan keterampilan dan kebrutalannya menjadi legendaris di zaman Pemulihan yang ia bantu bangun. Namun, saat pertempuran hampir berakhir, dia menghilang tanpa jejak, hanya untuk muncul kembali sebelas tahun kemudian sebagai pendekar pengembara, Himura Kenshin. Sekarang tinggal di dojo kenjutsu yang dikelola oleh seorang wanita pemarah bernama Kamiya Kaoru, dan dikelilingi oleh teman-teman baru seperti petarung jalanan Sagara Sanosuke, putra mantan samurai Myoujin Yahiko, dan dokter cerdik Takani Megumi, dia berusaha untuk melaksanakan sumpahnya untuk melindungi yang lemah tanpa membunuh untuk menebus nyawa yang diambilnya. Namun, tidak lama kemudian, sebelum sumpah ini diuji, dan bayang-bayang masa lalunya kembali menghantuinya dan semua orang yang dia sayangi.',
